  input: '"TEXT","F3XA","C00167320","Committee inadvertently failed to disclose bank
    fee paid to Peoples Bank on October 1, 2004 for $8.00. Said disbursement has been
    added to line 21(b) of this amended report.  Committee inadvertently failed to
    disclose partial reversal of payroll disbursement paid to Jonathan Crasnic.  Said
    reversal of disbursement for $959.95 has been added to line 21(b) of this amended
    report.  In response to the FECs letter dated May 25, 2005, the Committee conducted
    a full review of its 2004 checking account and FEC filings, and as a result has
    filed several amendments which have fixed the discrepancy between the beginning
    cash balance of this report and the ending balance of the October Monthly Report.
    Additionally, the totals listed on Lines 6(c), 7, 11(b), 11(c), 11(d), 15, 19,
    20, 21(a)(i), 21(a)(ii), 21(b), 21(c), 31, and 32, Column B of the Summary and
    Detailed Summary Pages have also been corrected as a result of the Committees
    2004 review.  The Committees calculations for Line 8 are now correct and cash-on-hand
    at the close of the  reporting period now equals the closing calendar year-to-date
    cash-on-hand amount.  In review of  the voter file consulting/data/software issue
    you reference in your letter of May 25, 2005  and in consultation with our legal
    counsel, we have determined that these activities do not meet the definition of
    Federal Election Activity as these expenditures were for costs incurred in the
    building of our voter file and therefore payment for these activities were appropriately
    disclosed on line 21 (a). In review of the payments for accounting services and
    voter file consulting services which you reference in your letter of May 25, 2005,
    please note that these payments were made to individuals who are independent contractors
    and not employees of this Committee."'
